import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, Button, Image } from 'react-native';
import { useState } from 'react';

const images = [{
  id: 1,
  url: 'data:image/jpeg;base64,',
  description: 'Image description 1'
},
{
  id: 2,
  url: 'data:image/jpeg;base64,',
  description: 'Image description 2'
},
{
  id: 3,
  url: 'data:image/jpeg;base64,',
  description: 'Image description 3'
}]

export default function App() {
  const [index, setIndex] = useState(0);

  function handleClick() {
    if(index<3){
      setIndex(index + 1);
    }
    
  }

  function handleReverseClick() {
    if(index>0){
      setIndex(index -1)
    }
   
  }

  let photos = images[index];

  return (
    <View style={styles.container}>
      <Button
        onPress={handleClick}
        title='Next'
        accessibilityLabel='Go to next photo' 
      />
      <br />
      <Image
        style={styles.img}
        source={photos.url}
      />
      <Text>{photos.description}</Text>

      <br />
      <Button
        onPress={handleReverseClick}
        title='Previous'
        accessibilityLabel='Go to next photo' 
      />

    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  img: {
    width: 300,
    height: 300
  },
});


